import React from "react";
import {connect} from "react-redux";
import {
    LoginWrapper,
    LoginBox,
    Input,
    Button
} from "./login_style";

class Login extends React.Component{

    render(){
        const {logIn} = this.props;
        return (
            <LoginWrapper>
                <LoginBox>
                    <h4 className="login-title">Login</h4>
                    
                    <Input placeholder="username" innerRef={(input)=>{ this.username=input}}></Input>
                    <Input placeholder="password" type="password" innerRef={(input)=>{this.password=input}}></Input>
                    <Button onClick={logIn(this.username, this.password)}>Log in</Button>
                </LoginBox>
            </LoginWrapper>
        )
    }
}

const mapDispatchToProps = (dispatch) =>{
    return {
        logIn(username, password){
            console.log(username, password);
        }
    }
}

export default Login;
